import React from "react";
import s from "../styles/avatar.module.scss";

export const Avatar = () => {
  return <div className={s.avatar}>
           <img src="https://i.pinimg.com/originals/e2/09/47/e209478247620709e0c8eca217ca6750.jpg" alt="tazzz" />
         </div>;
};
